import React from 'react';
import './projects.css'
//import * as THREE from 'three';

function proj() {

    return (
        <world >
            {/* <run onClick={loop()}/> */}
            <l1>spin</l1>
            <input type="checkbox" id="switch1"
					class="checkbox" />
		    <label for="switch1" class="toggle1"></label>

            <l2>direction</l2>
            <input type="checkbox" id="switch2"
					class="checkbox" />
		    <label for="switch2" class="toggle2">

            </label>

            <l3>speed</l3>
            <div class="speedslider">
            <input type="range" min="1" max="10" value="5" class="Sslider" id="speedRange"/>
            
            </div>

            <l4>zoom</l4>
            <div class="zoomslider">
                <input type="range" min="50" max="400" value="250" class="Zslider" id="zoomRange"/>
              
            </div>
        
            <l5>day</l5>
            <input type="checkbox" id="switch3" class="checkbox" />
		    <label for="switch3" class="toggle3"></label>
        </world>

    );

}
export default proj;
